import { Link } from "react-router-dom";

export function Home(){
    return(
        <div>
            <h1>[Home]</h1>
            <Link to="about">Перегляд</Link>
            <Link to="additions">Додати нову техніку</Link>
            <Link to="transfer">Виписати наряд</Link>
        </div>
    );
}

export function Revision(){
    return(
        <div>
            <h1>[Перегляд]</h1>
        </div>
    );
}

export function Additions(){
    return(
        <div>
            <h1>[Додати нову техніку]</h1>
        </div>
    );
}

export function Transfer(){
    return(
        <div>
            <h1>[Виписати наряд]</h1>
        </div>
    );
}



